// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

contract Ballot {
    struct Voter {
        uint noOfVotes;
        bool hasVoted;
        address delegate;
        uint vote;
    }

    struct Category {
        string name;
        uint voteCount;
    }

    address public moderator;

    mapping(address => Voter) public voters;

    Category[] public votingCategories;

    constructor() {
        moderator = msg.sender;
        voters[moderator].noOfVotes = 1;
    }


    function giveRightToVote(address _voter) public {
        require(msg.sender == moderator, "Only moderator has access"); // Verify `msg.sender` is the `moderator`
        require(!voters[_voter].hasVoted, "The voter already voted"); // Check if `_voter` hasn't voted
        require(voters[_voter].noOfVotes == 0, "Voter can't vote"); // Check if `voter` doesn't have existing voting rights
        voters[_voter].noOfVotes = 1; // Assign a voting noOfVotes of 1 to `_voter` and update their voting status
    }

    function delegate(address _to) public {
        Voter storage sender = voters[msg.sender];

        require(sender.noOfVotes > 0, "sender doesnt have voting rights"); // Require the sender to have voting rights
        require(!sender.hasVoted, "sender has already voted"); // Require the sender hasn't voted
        require(_to != msg.sender, "self delegating isn't allowed!!!"); // Require the sender is not self-delegating

        // Adjust vote counts based on the delegate's voting status
        // !sender.hasVoted; // this is not needed as it is already checked above
        sender.delegate = _to; // Set the sender's delegate to the `_to` address
        Voter storage delegate_ = voters[_to]; // The delegate is a voter as well.
        if (delegate_.hasVoted) {
            votingCategories[delegate_.vote].voteCount += sender.noOfVotes; // If the delegate has voted, increment the Category's vote count directly
        } else {
            delegate_.noOfVotes += sender.noOfVotes; // If the delegate hasn't voted, increment the delegate's noOfVotes
        }
        sender.noOfVotes = 0; //reset the senders noOfVotes back to 0;
    }

    function withdrawDelegation() public {
        Voter storage sender = voters[msg.sender];
        require(sender.noOfVotes > 0, "sender doesnt have voting rights"); // Require the sender to have voting rights
        require(!sender.hasVoted, "sender has already voted"); // Require the sender hasn't voted

        address _to = sender.delegate; // Set the `_to` address to the sender's delegate
        require(_to != msg.sender, "self de-delegating isn't allowed!!!"); // Require the sender is not self-de-delegating

        sender.noOfVotes = voters[_to].noOfVotes; // Set the sender's noOfVotes to the delegate's noOfVotes
        voters[_to].noOfVotes -= sender.noOfVotes; // reduce the delegate's noOfVotes by the sender's noOfVotes
        sender.delegate = address(0); // Set the sender's delegate to 0
    }

    function vote(uint256 _CategoryIndex) public {
        Voter storage sender = voters[msg.sender];
        require(sender.noOfVotes > 0, "voter has no right to vote"); // Require the sender to have voting rights
        require(!sender.hasVoted, "voter has already voted"); // Require the sender to hasn't voted

        // Increment the vote count for the chosen Category index
        // Record the vote and update the sender's voting status.
        sender.vote = _CategoryIndex; // Set the sender's vote to the `_CategoryIndex` value. This is the Category they are voting for
        votingCategories[_CategoryIndex].voteCount += sender.noOfVotes; // Increment the Category's vote count by the sender's noOfVotes
        sender.noOfVotes = 0; // Reset the sender's noOfVotes to 0 to prevent double voting
        sender.hasVoted = true; // Set the sender's voting status to true
    }

    function addCategory(string memory _name) public {
        votingCategories.push(Category({name: _name, voteCount: 0})); // push the created Category to the array
    }

    function winningCategory() public view returns (uint winningCategory_) {
        uint winningVoteCount = 0; // initialize the winning vote to zero
        for (uint prop = 0; prop < votingCategories.length; prop++) {
            // loop throught the Category array
            if (votingCategories[prop].voteCount > winningVoteCount) {
                // check if the Category voteCount is grater than winningVoteCount
                winningVoteCount = votingCategories[prop].voteCount; // set the winningVoteCount equal to the Category with highest count
                winningCategory_ = prop; // return the winning voteCount
            }
        }
    }

    function winningCategoryName () public view returns (string memory winningCategoryName_) {
        winningCategoryName_ = votingCategories[winningCategory()].name;
    }

    function getVotingCategories () public view returns (Category[] memory) {
        return votingCategories;
    }

    receive() external payable {}
}

